import React from 'react';

const User = ({user}) => {
  return (
    <div>
      <b>{user.username}</b><span>({user.email})</span>
    </div>
  )
  const UserList = () => {
    const users = [
      {
        id: 1,
        username: 'rkdud',
        email:'sdfs',
      },
      {
        id: 2,
        username: 'rbgk',
        email:'sdfs',
      },
      {
        id: 3,
        username: 'zzzz',
        email:'sdfs',
      }
    ]
}
  return (
    <div>
      <User />
    </div>
  );
};

export default UserList;
